import { Component } from "react";
import { Col } from "react-bootstrap";
import { Row } from "react-bootstrap";
import { connect } from "react-redux";


class PresentationOfTheCompany extends Component {
    render(){
        return(
            <>
            <Row>
                <Col lg={{offset:1, span:10}}>
                <div className="presentationOfTheCompany-body">
                    <div className="presentationOfTheCompany-CompanyInformation"> our</div>
                    presentationOfTheCompany
                    </div>
                </Col>
            </Row>
            </>
        )
    }
}




export default connect(null,null)(PresentationOfTheCompany)
